import React from "react";
import { IoIosArrowDown } from "react-icons/io";

function AddLiquidityModel() {
  return (
    <>
      <div className="fixed left-0 top-0 w-full h-screen flex items-center justify-center bg-black bg-opacity-50 z-20">
        <div className="bg-white p-5 text-white dark:bg-gray-900 rounded-xl shadow-lg w-[30%]">
          <p className="text-center text-xl"> Add Liquidity</p>
          <div className="border-t mt-5 border-gray-800">
            <p className="mt-4 text-lg">Select Pair</p>
            <div className="w-full flex gap-1 mt-6">
              <button
                // onClick={handleModal}
                className="w-1/2 flex justify- items-center text-white  bg-white dark:bg-gray-800 font-medium rounded-3xl text-lg px-4 py-2 text-center mr-3 md:mr-0"
              >
                Select a token
                <IoIosArrowDown />
              </button>{" "}
              <button
                // onClick={handleModal}
                className="w-1/2 flex justify-left items-center text-white top-[25%] right-4  bg-white dark:bg-gray-800 font-medium rounded-3xl text-lg px-4 py-2 text-center mr-3 md:mr-0"
              >
                Select a token
                <IoIosArrowDown />
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default AddLiquidityModel;
